        $regions = ["Southeast Asia", "East Asia", "North America"];
        $current_date = current_time('Ymd'); 

        foreach ($regions as $r) {
            $args = array(
                'post_type' => 'countries',
                'posts_per_page' => 1000,
                'orderby' => 'meta_value_num',
                'order' => 'DESC',
                'meta_key' => 'rating',
                'meta_query' => array(
                    'relation' => 'AND',
                    array(
                        'key' => 'active-date',
                        'compare' => '<=',
                        'value' => $current_date,
                        'type' => 'NUMERIC'
                    ),
                    array(
                        'key' => 'region',
                        'value' => $r,
                        'compare' => '==',
                    ),
                ),
            );
    
            $latest_travel = new WP_Query( $args );
            if ( $latest_travel->have_posts() ) {
                while ( $latest_travel->have_posts() ) {
                    $latest_travel->the_post();
                    $data = get_data(["cover-photo", "country", "flag", "get-permalink"], array());
                    if ( !empty($data["cover-photo"]) ) {
                        $bg = "url('" . image_array($data["cover-photo"], "large") . "')";
                        echo '<div class="card country-card" data-region="' . $r . '">
                                <div class="card-img-container" data-country="' . $data["country"] . '" onclick="select_country(this.dataset.country, ' . "'" . $r . "'" . ', ' . "'" . $data["flag"] . "'" . ');" style="--bg: ' . $bg . ';">
                            </div>
                            <p>' . $data["country"] . ' ' . $data["flag"] . '</p>
                            <a class="card-a" href="' . $data["get-permalink"] . '"><div class="button">Explore ' . $data["country"] . '</div></a>
                        </div>';
                    } 
                }
            }
        }

        $args = array(
            'post_type' => 'cities',
            'posts_per_page' => 1000,
            'orderby' => 'meta_value_num',
            'order' => 'DESC',
            'meta_key' => 'rating',
            'meta_query' => array(
                'relation' => 'AND',
                array(
                    'key' => 'active-date',
                    'compare' => '<=',
                    'value' => $current_date,
                    'type' => 'NUMERIC'
                )
            ),
        );
    
        $latest_travel = new WP_Query( $args );
        if ( $latest_travel->have_posts() ) {
            while ( $latest_travel->have_posts() ) {
                $latest_travel->the_post();
                $data = get_data(["cover-photo", "city", "country-post", ["country", "flag"], "get-permalink"], array());
                if ( !empty($data["cover-photo"]) ) {
                    $bg = "url('" . image_array($data["cover-photo"], "large") . "')";
                    echo '<a class="card-a" href="' . $data["get-permalink"] . '"><div class="card city-card" data-country="' . $data["country-post-country"] . '">
                            <div class="card-img-container" style="--bg: ' . $bg . ';">
                        </div>
                        <p>' . $data["city"] . '</p>
                    </div></a>';
                }
            }
        }
        
